import React from 'react';
// import './Projects.css';

const Projects = () => {
    return (
        <div className="projects">
            <text>PROJECTS PAGE</text>
            <button type="button"><a href="/home">Home</a></button>
            <button type="button"><a href="/projects">Projects</a></button>
            <button type="button"><a href="/art">Art</a></button>
            <button type="button"><a href="/resume">Resume</a></button>
        </div>   
    )
};

export default Projects;
